import React from 'react';
import './App.css'
import SideMenu from './components/SideMenu';
import Navbar from './components/Navbar';
import Overview from './Overview';
import ChatGPT from './ChatBot';
import UserDataCard from './components/UserDataCard';
import DetailsCard from './components/DetailsCard';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";



function App() {

  return (
    <>
    <Navbar/>
    <SideMenu />
    <Router>
      <Routes>
        <Route path="/" element={<Overview />} />
        <Route path="/ChatBot" element={<ChatGPT/>} />
        <Route path="/MyAccount" element={<UserDataCard
        username="JDoe"
        name="John Doe"
        balance="$123456.78"
        holdings="GOOG:78 APPL:15"
        profit="$123.45"
        loss="$234.56"
      />} />
      <Route path="/MyTransacHistory" element={<DetailsCard title="Card Title" body="Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua." />} />
      </Routes>
    </Router>
    </> 
  );
}

export default App;
